dependencies = [
    { name = "fastapi" },
    { name = "pydantic-settings" },
    { name = "typer" },
    { name = "uvicorn" },
]

[package.optional-dependencies]
mongo = [
    { name = "pymongo" },
]
sql = [
    { name = "psycopg", extra = ["binary"] },
    { name = "sqlalchemy" },
]

[package.dev-dependencies]
dev = [
    { name = "coverage" },
    { name = "faker" },
    { name = "httpx" },
    { name = "mypy" },
    { name = "pre-commit" },
    { name = "psycopg", extra = ["binary"] },
