    { name = "pytest" },
    { name = "ruff" },
    { name = "sqlalchemy" },
    { name = "ty" },
    { name = "watchfiles" },
]

[package.metadata]
requires-dist = [
    { name = "fastapi", specifier = ">=0.115" },
    { name = "psycopg", extras = ["binary"], marker = "extra == 'sql'", specifier = ">=3.2" },
