    { name = "pytest", specifier = ">=8.4" },
    { name = "ruff", specifier = "==0.12.0" },
    { name = "sqlalchemy", specifier = ">=2.0" },
    { name = "ty", specifier = ">=0.0" },
    { name = "watchfiles", specifier = ">=1.0" },
]
